# columns == heights[i].length
class UF:
    def __init__(self,heights):
        self.parent={}
        count=0
        n=len(heights)
        m=len(heights[0])
        for i in range(n*m):
            self.parent[i]=i

    def find(self,x):
        if self.parent[x]==x:
            return x
        else:
            self.parent[x]=self.find(self.parent[x])
            return self.parent[x]

    def union(self,x,y):
        if self.find(x)==self.find(y):
            return
        else:
            self.parent[self.find(x)]=self.find(y)

    def ans(self,x,y):
        if self.find(x)==self.find(y):
            return 1
        else:
            return 0
from collections import defaultdict
n=len(heights)
m=len(heights[0])
rowdict=defaultdict(list)
coldict=defaultdict(list)
for i in range(n):
    for j in range(m-1):
        if j<m-1:
            temp=abs(heights[i][j+1]-heights[i][j])
            rowdict[temp].append([i,j])
        if i<n-1:
            temp=abs(heights[i+1][j]-heights[i][j])
            coldict[temp].append([i,j])
uf=UF(heights)
i=0
while uf.ans(0,n*m-1)==0:
    for item in rowdict[i]:
        uf.union(item[0]+n*item[1],item[0]+n*(item[1]+1))
    for item in coldict[i]:
        uf.union(item[0]+n*item[1],item[0]+1+n*item[1])
    i+=1
print(i-1)